import React from 'react';
import { PromoSlider } from '../PromoSlider';
import { CartSlider } from '../ProductsSlider';
import './HomePage.scss';
import { Category } from '../Category';
import phones from '../../data/phones.json';

export const HomePage = () => {

  return (
    <div className="HomePage">
      <PromoSlider />
      <CartSlider title="Hot prices" products={[...phones].filter(cart => cart.price.length > 1)}/>
      <Category />
      <CartSlider title="Brand new models" products={[...phones].filter(cart => cart.price.length === 1).sort((a, b) => a.id - b.id)}/>
    </div>
  )
}
